import React from "react";
import BackButton from "./Buttons/BackButton";
import Zoom from "@material-ui/core/Zoom";
import UpBotton from "./Buttons/UpButton"
import { MainDiv, StyledPaper, Text} from "./styles/ContentPages"


export default function Bio(props) {
  return (
    <MainDiv>
      <BackButton onClick={() => props.transition("MENU")} />
      <Zoom in={true}>
        <StyledPaper>
          <Text>
            Pictures of charlie go here, maybe a cool slide show or something....
          </Text>
          <UpBotton onClick={() => props.scrollUp()}/>
        </StyledPaper>
      </Zoom>

    </MainDiv>
  );
}
